const DiscussForm=()=>{
    return( 
         <Main><Form>
             <Col><div style={{display:"flex",flexFlow:"column"}}>     <Label for="html">HTML</Label><Input/></div>
         <Label for="html">HTML</Label>
        <Input/>
  </Col><Col><Label for="html">HTML</Label><Input/>
